// src/App.js
import './App.css'; // Esto puede quedar o se puede quitar si no lo usaremos
import React from 'react';

function App() {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-4">
      <h1 className="text-5xl font-bold text-blue-600 mb-4">
        ¡Bienvenido a ITAM System!
      </h1>
      <p className="text-lg text-gray-700">
        Tu frontend React con Tailwind CSS está listo.
      </p>
      <button className="mt-6 px-6 py-3 bg-green-500 text-white rounded-lg shadow-md hover:bg-green-600 transition duration-300">
        ¡Comencemos!
      </button>
    </div>
  );
}

export default App;
